import React from "react";
import "./index.scss";
const Header = () => {
  return (
    <>
      <div className="navigation">
        <div className="navigation-container">
          <img src="" alt="altLogo" className="navigation-container-logo" />
        </div>
      </div>
    </>
  );
};

export default Header;
